import './App.css';
//import Shop from './component/shop';



import React from 'react';

const Student = (props) => {
  return <li>{props.module}</li>;
}

const LectureHall = () => {
  const modules = ['Math', 'Science', 'History', 'Literature'];

  return (
    <>
      <p>Modules in the lecture hall:</p>
      <ul>
        {modules.map((module, index) => (
          <Student key={index} module={module} />
        ))}
      </ul>
    </>
  );
}

function App() {
  return (
    <>
      <LectureHall />
    </>
  );
}

export default App;
